(window.webpackJsonp=window.webpackJsonp||[]).push([[53],{1173:function(e){e.exports={content:'<h2>\u9605\u8bfb<a href="https://github.com/chenglou/react-motion">react-motion</a>\u7684\u6e90\u7801\u65f6\u5019\uff0c\u5176\u4e2d\u6709\u4e00\u4e2a\u7ec4\u4ef6<code>TransitionMotion</code>\n\uff0c\u5b83\u8d1f\u8d23\u5143\u7d20\u7684\u65b0\u589e\u548c\u79fb\u9664\u52a8\u753b\uff0c\u5185\u90e8\u67092\u4e2a\u6982\u5ff5\uff1a<code>old</code>\u548c<code>new</code></h2>\n<p>\u8fd9\u5c31\u5148\u8bf4\u5230\u6392\u5e8f\uff0c</p>\n<p>\u5f53\u52a8\u753b\u961f\u5217\u51fa\u73b0\u5982\u4e0b\u72b6\u6001\u65f6\uff0c\u8be5\u5982\u4f55\u5904\u7406\uff1a</p>\n<p>\u65e7\u7684\u5e8f\u5217\uff1a <code>a -&gt; b -&gt; x</code></p>\n<p>\u65b0\u7684\u5e8f\u5217\uff1a <code>c -&gt; b -&gt; d</code></p>\n<p>\u8fd9\u91cc\u6d89\u53ca\u5230<code>\u62d3\u6251\u6392\u5e8f</code>\u7684\u601d\u60f3</p>\n<ol>\n<li>\n<p><code>a</code>\u548c<code>c</code>\u7684\u5165\u53e3\u70b9\u4e3a0\uff0c\u56e0\u6b64 <code>a</code>\u548c<code>c</code> \u5728<code>b</code>\u7684\u524d\u9762\u6267\u884c\uff0c</p>\n</li>\n<li>\n<p>\u6267\u884c\u5b8c<code>a</code>\u548c<code>c</code>\u540e\uff0c<code>b</code>\u7684\u5165\u53e3\u70b9\u4e3a0\uff0c\u56e0\u6b64<code>b</code>\u5728 <code>x</code>\u548c<code>d</code>\u7684\u524d\u9762\u6267\u884c\uff0c</p>\n</li>\n<li>\n<p>\u90a3\u4e48<code>a</code>\u548c<code>c</code>\u7684\u987a\u5e8f\uff0c<code>x</code>\u548c<code>d</code>\u7684\u987a\u5e8f\u600e\u4e48\u5224\u65ad</p>\n</li>\n</ol>\n<p>\u5b9e\u9645\u64cd\u4f5c\u662f\u4f7f\u7528\u539f\u751f<code>sort</code>\u65b9\u6cd5\uff0c<code>sort</code>\u5bf9\u6bd4\u53c2\u6570\u52064\u79cd\u60c5\u51b5\uff1a</p>\n<ol>\n<li>\u4e24\u8005\u90fd\u5728\u65e7\u5e8f\u5217\uff0c\u90a3\u4e48\u5c31\u6309\u65e7\u7684\u6392\u5e8f</li>\n<li>\u4e24\u8005\u90fd\u5728\u65b0\u5e8f\u5217\uff0c\u90a3\u4e48\u5c31\u6309\u65b0\u7684\u6392\u5e8f</li>\n<li>x\u5728\u65e7\uff0cy\u5728\u65b0\uff0c\u90a3\u4e48\u627ex\u548cy\u7684\u4e2d\u95f4\u503c\uff0c\u4f8b\u5982<code>a</code>\u548c<code>d</code>\u7684\u4e2d\u95f4\u503c\u5c31\u662f<code>b</code>\uff0c\u7136\u540e\u6839\u636e\u4e2d\u95f4\u503c\u6392\u5e8f</li>\n<li>x\u5728\u65e7\uff0cy\u5728\u65b0\uff0c\u65e0\u4e2d\u95f4\u503c\uff0c\u90a3\u4e48\u6309\u7167\u65e7\u5e8f\u5217\u4f18\u5148\uff0c\u5373<code>a-&gt;c</code>\uff0c<code>x-&gt;d</code></li>\n</ol>\n<hr>\n<p>\u901a\u8fc7\u6392\u5e8f\u4e5f\u5b9a\u4e49\u4e86\u5185\u90e8\u7684new\u548cold\u7684\u533a\u522b\uff1a</p>\n<pre class="hljs"><code>* old\u4ee3\u8868\u672a\u6392\u5e8f\u7684\u52a8\u753b\u5217\u8868\u6216\u8005\u6570\u636e\n\u4f8b\u5982\uff1aoldMergedPropsStyles\u5c31\u662f\u672a\u6392\u5e8f\u7684mergedPropsStyles\noldMergedPropsStyles\noldCurrentStyles\noldCurrentVelocities\noldLastIdealStyles\noldLastIdealVelocities\n----------------------------\n* new\u4ee3\u8868\u5df2\u7ecf\u6392\u5e8f\u7684\u52a8\u753b\u5217\u8868\u6216\u8005\u6570\u636e\n\u4f8b\u5982\uff1anewMergedPropsStyles\u5c31\u662f\u5df2\u7ecf\u6392\u597d\u5e8f\u7684mergedPropsStyles\nnewMergedPropsStyles, \nnewCurrentStyles, \nnewCurrentVelocities, \nnewLastIdealStyles, \nnewLastIdealVelocities\n</code></pre>\n<p>\u66f4\u8be6\u7ec6\u67e5\u770b[react-motion\u6e90\u7801\u9605\u8bfb]</p>\n'}}}]);
